import logo from './logo.svg';
import './App.css';

function App() {

  const difficulties = [
    { name: 'Easy', value: 1 },
    { name: 'Normal', value: 2 },
    { name: 'Hard', value: 3 },
    { name: 'God Mode', value: 4}
  ];

  const handleDifficultyClick = (value) => {
    console.log(`Selected difficulty: ${value}`);
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
          <p>
            Let's play a small game, choose a difficulty
          </p>
        </div>
        <div className='difficulty_selector'>
          {difficulties.map((difficulty) => (
            <button
              key={difficulty.value}
              type="button"
              className='button-34'
              onClick={() => handleDifficultyClick(difficulty.value)}
            >
              {difficulty.name}
            </button>
          ))}
        </div>
      </header>
    </div>
  );
}

export default App;
